import React from 'react'
import {Outlet} from 'react-router-dom'
import './Menu.css'

import MenuNavbar from './menu/MenuNavbar.js'

function Menu() {
  return (
    <div id='menu'>
      <Outlet />
      <MenuNavbar />
      
    </div>
  )
}

export default Menu
